        public int MaximumElementAfterDecrementingAndRearranging(int[] arr)
        {
            return Solution1(arr);
        }

        private int Solution1(int[] arr)
        {
            Array.Sort(arr);
            var maxValue = 0;
            arr[0] = 1;
            for (var i = 0; i < arr.Length - 1; i++)
            {
                var diff = arr[i + 1] - arr[i];
                if (diff > 1)
                {
                    arr[i + 1] = arr[i + 1] - diff + 1;
                }
                if (maxValue < arr[i + 1]) maxValue = arr[i + 1];
            }
            return maxValue > arr.Length ? arr.Length : maxValue;
        }

        private int Solution2(int[] arr)
        {
            var dic = new Dictionary<int, int>();
            foreach (var item in arr)
            {
                if (!dic.ContainsKey(item))
                {
                    dic.Add(item, 0);
                }
                dic[item]++;
            }

            (int key, int value) maxCountedPair = (0, 0);
            foreach (var item in dic.Keys)
            {
                if (dic[item] > maxCountedPair.value)
                {
                    maxCountedPair = (item, dic[item]);
                }
            }

            if (maxCountedPair.key == maxCountedPair.value)
            {
                return dic.Count;
            }
            if (maxCountedPair.key > maxCountedPair.value)
            {
                return maxCountedPair.value;
            }

            foreach (var item in dic.Keys)
            {
                if (item > maxCountedPair.key)
                {
                    return maxCountedPair.key + 1;
                }
            }

            return maxCountedPair.key;
        }
    }
